                <textarea placeholder='Биография'/>
                <input placeholder='Возраст'/>
                <label htmlFor='isHappy'>Счастлив?</label>
                <input type='checkbox' id='isHappy'/>
                <button type='button'>Добавить</button>


            </form>
        )
    }
} 

export default AddUser
